import styled from 'styled-components'

const BackgroundLogin = styled.div`
background-color: #292929;
height:100vh;
`

function LoginPage() {
    return (
        <BackgroundLogin>
            <div>
                <div>
                    <div>
                        <div>
                        <div>

</div>
                        </div>
                    </div>
                </div>
            </div>
        </BackgroundLogin>
    );
}

export default LoginPage;
